records.addlTxt:
Defendant in custody.
GUILTY Plea entered to count 1, OWI  6th offense.  Convicted.
The State moves to dismiss and read in counts 2 and 3.  Motion granted.
The defendant is sentenced to the Wisconsin State Prison System for a total of three (3) years.  That is one (1) year initial confinement followed by two (2) years extended supervision.
The Court finds the defendant not eligible for the Challenge Incarceration Program but eligible for the Substance Abuse Program.
Conditions of extended supervision:
1) Maintain absolute sobriety;
2) Maintain fulltime employment or work search;
3) AODA assessment and follow through/ Intoxicated Driver Assessment and Driver Safety Plan;
4) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
5) Pay a $1,100.00 fine plus costs, total of $2,450.00;
6) pay supervision fees in an amount to be determined by DOC;
7) provide DNA sample.
Thirty-six (36) months DL revocation and IID ordered.
Minutes.
